class Solution(object):
    def slidingPuzzle(self, board):
        """
        :type board: List[List[int]]
        :rtype: int
        """

        def swap(board, i, j):
            board[i][j], board[i][j + 1] = board[i][j + 1], board[i][j]
            return board

        def isSolved(board):
            return board == [[1,2,3],[4,5,0]]

        def getZero(board):
            for i in range(len(board)):
                for j in range(len(board[0])):
                    if board[i][j] == 0:
                        return i, j
            return None

        def getNeighbors(board):
            zero = getZero(board)
            i, j = zero
            neighbors = []
            if i + 1 < len(board):
                neighbors.append(swap(board, i, j))
            if i - 1 >= 0:
                neighbors.append(swap(board, i, j))
            if j + 1 < len(board[0]):
                neighbors.append(swap(board, i, j))
            if j - 1 >= 0:
                neighbors.append(swap(board, i, j))
            return neighbors

        def solve(board):
            if isSolved(board):
                return 0
            neighbors = getNeighbors(board)
            for neighbor in neighbors:
                result = solve(neighbor)
                if result != -1:
                    return result + 1
            return -1

        return solve(board)

